      constructor(method, uri, callback) {
        if (uri instanceof RegExp) {
          this.regex = uri;
        } else {
          this.regex = regifyString(uri, {});
        }
        this.method = method.toUpperCase();
        if (callback != null) {
          this.callback = callback;
        }
      }

      match(method, uri) {
        var matches;
        if (uri == null) {
          uri = method;
          method = null;
        }
        if ((method != null) && this.method !== method.toUpperCase()) {
          return false;
        }
        matches = this.regex.exec(uri);
        if (matches && (matches.length != null)) {
          return matches.slice(1);
        }
        return false;
      }

    };

    // The following methods are CoffeeScript ports of JS from
    // the Director router.
